import React, { useEffect } from "react";
import YandexMapConstructor from "react-yandex-maps-constructor";

function MapComponent() {
  const mapWidth = 1000;
  const mapHeight = 1000;

  // Формируем URL с учетом ширины и высоты из переменных
  const mapUrl = `https://api-maps.yandex.ru/services/constructor/1.0/js/?um=constructor%3Ac46e5e336d5367fa5409fa8e1f528d3da54862723a35eda531bb62aabab498d5&amp;width=${mapWidth}&amp;height=${mapHeight}&amp;lang=ru_RU&amp;scroll=true`;

  return (
    <div>
      <YandexMapConstructor
        script={`<script type="text/javascript" charset="utf-8" async src="${mapUrl}"></script>`}
      />
    </div>
  );
}
export default MapComponent;
